function App() {
    return (
      <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={(<Home/>)} />
            <Route path='/comps' element={(<Comps/>)}/>
            <Route path='/elo' element={(<ELO/>)}/>
            <Route path='/teams' element={(<Teams/>)}/>
          </Routes>
        </BrowserRouter>
      </div>
    );
  }

  export default App;
